import{r,o as t,c as n,a as e,b as o,F as a,d as s,e as c}from"./app.9aaa2256.js";import{_ as d}from"./plugin-vue_export-helper.21dcd24c.js";const i={},_=s('<h3 id="\u6795\u79C3\u4E0D\u662F\u75C5-\u5168\u6C11\u8865\u9499\u624D\u662F\u75C5" tabindex="-1"><a class="header-anchor" href="#\u6795\u79C3\u4E0D\u662F\u75C5-\u5168\u6C11\u8865\u9499\u624D\u662F\u75C5" aria-hidden="true">#</a> \u6795\u79C3\u4E0D\u662F\u75C5\uFF0C\u5168\u6C11\u8865\u9499\u624D\u662F\u75C5</h3><p>\u5F88\u591A\u5BB6\u957F\u53EF\u80FD\u6CE8\u610F\u5230\uFF0C\u5B69\u5B50\u751F\u4E0B\u6765\u6CA1\u51E0\u4E2A\u6708\uFF0C\u540E\u8111\u52FA\u4E00\u5708\u5934\u53D1\u5C31\u6389\u5149\u4E86\uFF0C\u5149\u79C3\u79C3\u7684\u751A\u4E3A\u96BE\u770B\uFF0C\u88AB\u5C0F\u533A\u91CC\u70ED\u5FC3\u4EBA\u770B\u5230\u4E86\uFF0C\u8BF4\uFF1A\u201C\u4F60\u5B69\u5B50\u7F3A\u9499\u5440\uFF0C\u8981\u8865\u9499\uFF0C\u8981\u53BB\u770B\u533B\u751F\u3002\u201D</p><p>\u4E8B\u5B9E\u4E0A\uFF0C\u70ED\u5FC3\u4EBA\u7684\u8BF4\u6CD5\u4E0D\u65E0\u9053\u7406\uFF0C\u56E0\u4E3A\u6795\u79C3\u662F\u56E0\u4E3A\u7F3A\u9499\u7684\u8BF4\u6CD5\u786E\u5B9E\u6765\u6E90\u4E8E\u533B\u751F\u3002\u4F46\u533B\u751F\u4E5F\u4E0D\u662F\u6709\u610F\u8981\u6B3A\u9A97\u5BB6\u957F\uFF0C\u597D\u591A\u5F00\u70B9\u9499\u7247\u6216\u9C7C\u809D\u6CB9\uFF0C\u800C\u662F\u5F88\u591A\u533B\u751F\u4E5F\u76F8\u4FE1\u6795\u79C3\u5C31\u662F\u7F3A\u9499\u3001\u4F5D\u507B\u75C5\u7684\u8868\u73B0\u3002\u6211\u4EEC\u5F53\u5E74\u8BFB\u4E66\u65F6\u7684\u6559\u6750\uFF0C\u5C31\u662F\u628A\u6795\u79C3\u5F53\u505A\u4F5D\u507B\u75C5\u7684\u4E00\u4E2A\u75C7\u72B6\u3002</p><p>\u6240\u4EE5\u5F53\u4F60\u56E0\u4E3A\u5B69\u5B50\u6795\u79C3\u5E26\u53BB\u770B\u533B\u751F\uFF0C\u533B\u751F\u4E0D\u95EE\u5B69\u5B50\u5E74\u9F84\uFF0C\u4E5F\u4E0D\u95EE\u6709\u6CA1\u6709\u5176\u5B83\u75C7\u72B6\uFF0C\u7ED9\u5B69\u5B50\u5F00\u4E00\u5806\u9C7C\u809D\u6CB9\u548C\u9499\u7247\u4F60\u4E5F\u4E0D\u7528\u5947\u602A\u3002\u5C31\u8FDE\u533B\u836F\u4E13\u4E1A\u7F51\u7AD9\u4E01\u9999\u56ED\uFF0C\u4E5F\u66FE\u5728\u4E00\u7BC7\u63A8\u9001\u6587\u7AE0\uFF0C\u4F5C\u8005\u5BF9\u7740\u4E00\u5F20\u6795\u79C3\u7684\u56FE\u7247\u8BF4\uFF1A\u8FD9\u662F\u5C0F\u670B\u53CB\u7F3A\u9499\u6795\u79C3\uFF0C\u8865\u9499\u5C31\u597D\u4E86\u3002\u6795\u79C3\u5C31\u662F\u7F3A\u9499\uFF1F</p><p>\u65E9\u57281907\u5E74\uFF0C\u5C31\u6709\u533B\u751F\u6CE8\u610F\u5230\u4E86\u6795\u79C3\u8FD9\u79CD\u73B0\u8C61\uFF0C\u4E0D\u8FC7\u8FD9\u79CD\u73B0\u8C61\u9664\u4E86\u5916\u89C2\u6709\u70B9\u96BE\u770B\uFF0C\u5E76\u4E0D\u5BF9\u5B69\u5B50\u9020\u6210\u4EC0\u4E48\u5F71\u54CD\uFF0C\u9664\u4E86\u56FD\u5185\uFF0C\u4E00\u76F4\u6CA1\u591A\u5C11\u533B\u751F\u5173\u6CE8\u8FD9\u4E2A\u95EE\u9898\uFF0C\u6240\u4EE5\u7814\u7A76\u4E5F\u6BD4\u8F83\u5C11\uFF0C\u4F46\u4E5F\u4E0D\u662F\u6CA1\u6709\u3002</p><p>\u56E0\u4E3A\u6795\u90E8\u662F\u63A5\u89E6\u6795\u5934\u548C\u5E8A\u57AB\u7684\u5730\u65B9\uFF0C\u800C\u5B69\u5B50\u7761\u89C9\u65F6\u95F4\u6BD4\u8F83\u591A\uFF0C\u6240\u4EE5\u5F88\u81EA\u7136\u7684\u63A8\u65AD\u6795\u79C3\u662F\u56E0\u4E3A\u5934\u76AE\u6469\u64E6\u5BFC\u81F4\u7684\u5934\u53D1\u8131\u843D\uFF0C\u56FD\u5185\u4E00\u4E9B\u4E13\u5BB6\u8BA4\u4E3A\u4F5D\u507B\u75C5\u7684\u5B69\u5B50\u591A\u6C57\uFF0C\u5B69\u5B50\u7761\u89C9\u65F6\u5019\u4E0D\u8212\u670D\u559C\u6B22\u78E8\u8E6D\u5934\u76AE\uFF0C\u6240\u4EE5\u5F62\u6210\u6795\u79C3\uFF0C\u7167\u8FD9\u6837\u7684\u63A8\u8BBA\uFF0C\u5982\u679C\u5B69\u5B50\u4E0D\u662F\u4EF0\u5367\u7684\u8BDD\uFF0C\u5C31\u5E94\u8BE5\u4E0D\u4F1A\u6795\u79C3\u4E86\u3002</p><p>\u4E3A\u4E86\u964D\u4F4E\u5A74\u513F\u731D\u6B7B\u7684\u98CE\u9669\uFF0C\u7F8E\u56FD\u513F\u79D1\u5B66\u4F1A\u4ECE1992\u5E74\u5F00\u59CB\u63A8\u83501\u5C81\u4EE5\u5185\u7684\u5B69\u5B50\u4EF0\u5367\uFF0C\u8FD9\u4E2A\u63A8\u8350\u6070\u597D\u4E3A\u6795\u79C3\u548C\u7761\u59FF\u7684\u5173\u7CFB\u63D0\u4F9B\u4E86\u5BF9\u6BD4\uFF0C\u6709\u4EBA\u5C31\u5C31\u505A\u4E86\u4E2A\u5BF9\u6BD4\u7814\u7A76\u3002</p><p>\u5728\u63A8\u8350\u4EF0\u5367\u4E4B\u524D\u76841985\u5E74\uFF0C200\u4E2A\u5B69\u5B50\u91CC\u6795\u79C3\u7684\u5B69\u5B50\u670918\u4E2A\uFF0C\u800C\u63A8\u8350\u4EF0\u5367\u4E4B\u540E2003\u5E74\uFF0C101\u4E2A\u5B69\u5B50\u91CC\u6795\u79C3\u7684\u670912\u4E2A\uFF0C\u867D\u7136\u4EF0\u5367\u7684\u5B69\u5B50\u6795\u79C3\u7684\u6BD4\u4F8B\u66F4\u9AD8\u4E00\u4E9B\uFF0C\u4F46\u4E24\u8005\u5E76\u6CA1\u6709\u7EDF\u8BA1\u5B66\u5DEE\u5F02\u3002\u800C\u4E14\u4F5C\u8005\u4E5F\u6CE8\u610F\u5230\uFF0C\u6709\u7684\u5B69\u5B50\u8131\u53D1\u5E76\u4E0D\u662F\u96C6\u4E2D\u5728\u6795\u90E8\u800C\u662F\u4E0B\u9762\u8FD9\u79CD\u60C5\u51B5\uFF0C\u8FD9\u663E\u7136\u65E0\u6CD5\u7528\u78E8\u8E6D\u53BB\u89E3\u91CA\u7684\u3002</p><p><strong>\u90A3\u662F\u4EC0\u4E48\u9020\u6210\u4E86\u6795\u79C3\uFF1F</strong></p><p>\u5728\u52A8\u7269\u754C\uFF0C\u6BDB\u53D1\u751F\u957F\u662F\u6709\u5468\u671F\u7684\uFF0C\u5728\u51AC\u5929\u6BDB\u53D1\u6301\u7EED\u751F\u957F\uFF0C\u800C\u5230\u4E86\u590F\u5929\u6BDB\u53D1\u5C31\u505C\u6B62\u4E86\u751F\u957F\u800C\u8FDB\u5165\u4F11\u6B62\u671F\uFF0C\u63A5\u7740\u5F00\u59CB\u4E86\u8131\u53D1\uFF0C\u957F\u65B0\u53D1\u3002</p><p>\u80CE\u513F\u4E5F\u5B58\u5728\u8FD9\u79CD\u73B0\u8C61\uFF0C\u5728\u5B5520\u5468\u65F6\uFF0C\u5934\u76AE\u4E0A\u51FA\u73B0\u6BDB\u53D1\uFF0C\u8FD9\u4E9B\u662F\u65E0\u9AD3\u7684\u80CE\u53D1\uFF0C\u5728\u80CE\u9F84\u7EA65\u4E2A\u6708\u7684\u65F6\u5019\uFF0C\u989D\u9AA8\u548C\u9876\u9AA8\u7684\u80CE\u53D1\u4ECE\u751F\u957F\u671F\u8FDB\u5165\u4F11\u6B62\u671F\uFF0C\u800C\u6795\u90E8\u7684\u80CE\u53D1\u5374\u6CA1\u6709\u8FDB\u5165\u8FD9\u4E2A\u5468\u671F\u3002</p><p>\u989D\u9876\u90E8\u7684\u80CE\u53D1\u5728\u80CE\u9F847-8\u6708\u7684\u65F6\u5019\u8131\u843D\uFF0C\u7136\u540E\u5F00\u59CB\u957F\u51FA\u7B2C\u4E8C\u6279\u6B21\u7684\u5934\u53D1\u3002\u800C\u6795\u90E8\u7684\u80CE\u53D1\u5374\u4E00\u76F4\u4FDD\u7559\u5230\u4E34\u4EA7\u671F\u624D\u8FDB\u5165\u4F11\u6B62\u671F\uFF0C\u7136\u540E\u5728\u751F\u540E8-12\u5468\u5F00\u59CB\u8131\u843D\uFF0C\u8FD9\u6070\u597D\u548C\u6795\u79C3\u4E3B\u8981\u51FA\u73B0\u57282-3\u4E2A\u6708\u7684\u5B69\u5B50\u543B\u5408\u3002\u800C\u51FA\u751F\u540E\u5B69\u5B50\u56E0\u4E3A\u7761\u7720\u65F6\u95F4\u6BD4\u8F83\u591A\uFF0C\u6795\u90E8\u7684\u7684\u6469\u64E6\u4E0D\u53EF\u907F\u514D\uFF0C\u6B63\u597D\u52A0\u901F\u4E86\u6795\u90E8\u80CE\u53D1\u7684\u8131\u843D\uFF0C\u6240\u4EE5\u5C31\u51FA\u73B0\u4E86\u6795\u79C3\u3002</p><p>\u4F46\u8FD9\u4E2A\u6362\u53D1\u8FC7\u7A0B\u5E76\u4E0D\u662F\u5B8C\u5168\u540C\u6B65\u7684\uFF0C\u5728\u65E7\u53D1\u8131\u843D\u7684\u540C\u65F6\u65B0\u53D1\u4E5F\u5728\u751F\u957F\uFF0C\u6709\u4E9B\u5B69\u5B50\u7684\u6795\u79C3\u5E76\u4E0D\u660E\u663E\u3002\u6240\u4EE5<strong>\u6795\u79C3\u662F\u5B69\u5B50\u6362\u53D1\u5BFC\u81F4\u7684\u751F\u7406\u73B0\u8C61\u800C\u4E0D\u662F\u4EC0\u4E48\u75BE\u75C5\uFF0C\u6795\u90E8\u6469\u64E6\u53EA\u662F\u52A0\u901F\u4E86\u8FD9\u4E2A\u6362\u53D1\u7684\u8FC7\u7A0B</strong>\u3002\u4EE5\u4E0A\u662F2005\u5E74\u53D1\u8868\u4E8E\u300A\u6B27\u6D32\u513F\u79D1\u5B66\u6742\u5FD7\u300B\u7684\u4E00\u7BC7\u6587\u7AE0\u7684\u5206\u6790\u3002</p><p>\u968F\u540E\u57282011\u5E74\uFF0C\u97E9\u56FD\u4EBA\u7684\u4E00\u7BC7\u6587\u7AE0\u5BF9193\u4E2A\u5B69\u5B50\u8FDB\u884C\u7EDF\u8BA1\uFF0C\u6795\u79C3\u7684\u5B69\u5B50\u7EA620.2%\uFF0C\u5BF9\u539F\u56E0\u8FDB\u884C\u5206\u6790\u4E5F\u6CA1\u53D1\u73B0\u548C\u7761\u59FF\u7684\u5173\u7CFB\uFF0C\u76F8\u53CD<strong>\u6795\u79C3\u548C\u6BCD\u4EB2\u7684\u5206\u5A29\u5E74\u9F84\u3001\u5206\u5A29\u65B9\u5F0F\u3001\u548C\u80CE\u9F84\u6709\u5173</strong>\u3002\u6BCD\u4EB2\u5206\u5A29\u5E74\u9F84\u8D85\u8FC735\u5C81\uFF0C\u5256\u8179\u4EA7\uFF0C\u80CE\u9F84\u8D85\u8FC737\u5468\u7684\u5B69\u5B50\u51FA\u73B0\u6795\u79C3\u7684\u6982\u7387\u8981\u589E\u9AD8\u3002\u8FD9\u4E2A\u7814\u7A76\u8FDB\u4E00\u6B65\u652F\u6301\u4E86\u6795\u79C3\u662F\u4E00\u79CD\u751F\u7406\u73B0\u8C61\u800C\u4E0D\u662F\u6469\u64E6\u5BFC\u81F4\u7684\u89C2\u70B9\u3002</p><p><strong>\u6795\u79C3\u548C\u7F3A\u9499\u3001\u4F5D\u507B\u75C5\u6709\u5173\u7CFB\u5417\uFF1F</strong></p><p>\u6795\u79C3\u662F\u7F3A\u9499\u548C\u4F5D\u507B\u75C5\u7684\u8868\u73B0\uFF0C\u8FD9\u79CD\u8BF4\u6CD5\u4E3B\u8981\u6D41\u884C\u4E8E\u56FD\u5185\u3002\u7FFB\u9605\u6700\u65B0\u7248\u7684\u300A\u5C3C\u5C14\u68EE\u513F\u79D1\u5B66\u300B\u4F5D\u507B\u75C5\u7684\u7AE0\u8282\u91CC\uFF0C\u4E5F\u6CA1\u6709\u770B\u5230\u4EFB\u4F55\u548C\u6795\u79C3\u76F8\u5173\u7684\u6587\u5B57\u3002\u89E3\u94C3\u8FD8\u987B\u7CFB\u94C3\u4EBA\uFF0C\u56FD\u4EBA\u63D0\u51FA\u7684\u89C2\u70B9\uFF0C\u6070\u597D\u4E5F\u6709\u4EBA\u505A\u4E86\u8FD9\u65B9\u9762\u7684\u7814\u7A76\u3002</p><p>2004\u5E74\u9752\u5C9B\u5C31\u6709\u533B\u751F\u5BF9\u56DB\u767E\u591A\u540D\u513F\u7AE5\u8FDB\u884C\u5206\u6790\uFF0C\u53D1\u73B0\u6795\u79C3\u53D1\u751F\u738742.1%, 3\u6708\u9F84\u53D1\u751F\u7387\u6700\u9AD8 ,\u968F\u6708\u9F84\u589E\u52A0\u800C\u51CF\u5C11\u3002\u6240\u6709\u75C5\u4F8B\u8FDB\u884C\u8840\u9AA8\u78B1\u6027\u78F7\u9178\u9176\uFF08\u5224\u65AD\u6210\u9AA8\u7EC6\u80DE\u6D3B\u6027\uFF0C\u4F5D\u507B\u75C5\u8BCA\u65AD\u5E38\u7528\u7684\u4E00\u4E2A\u53C2\u8003\u6307\u6807\uFF09\u6D4B\u5B9A\uFF0C\u6795\u79C3\u7EC4\u4E0E\u5BF9\u7167\u7EC4\u540440\u4F8B\u8FDB\u884C\u8840\u6E05\u9499\u6D4B\u5B9A\u5206\u6790\uFF0C\u7ED3\u679C\u5E76\u65E0\u660E\u663E\u5DEE\u5F02\u3002</p><p>\u6240\u4EE5\u4F5C\u8005\u4E5F\u8BA4\u4E3A\u6795\u79C3\u4E3A\u5C0F\u513F\u7684\u751F\u7406\u73B0\u8C61 ,\u4E0E\u9499\u3001\u7EF4\u751F\u7D20D\u7684\u6444\u5165\u91CF\u5173\u7CFB\u4E0D\u660E\u663E\u3002\u5F53\u7136\u4F60\u53EF\u80FD\u8FD8\u662F\u4F1A\u89C9\u5F97\u4E0A\u9762\u8FD9\u4E9B\u90FD\u662F\u4E00\u5BB6\u4E4B\u8A00\uFF0C\u8BA9\u6211\u4EEC\u770B\u770B\u6743\u5A01\u673A\u6784\u7684\u89C2\u70B9\u3002</p><p><strong>\u6743\u5A01\u673A\u6784\u7684\u770B\u6CD5</strong></p><p>\u7F8E\u56FD\u513F\u79D1\u5B66\u4F1A\u65D7\u4E0B\u79D1\u666E\u7F51\u7AD9healthchildren.org\u5173\u4E8E\u5B69\u5B50\u8131\u53D1\u662F\u8FD9\u6837\u5199\u7684\uFF1A\u201C\u51E0\u4E4E\u6240\u6709\u7684\u65B0\u751F\u513F\u90FD\u4F1A\u6389\u90E8\u5206\u6216\u5168\u90E8\u5934\u53D1\uFF0C\u8FD9\u662F\u53EF\u4EE5\u610F\u6599\u4E4B\u4E2D\u7684\u6B63\u5E38\u73B0\u8C61\u3002\u5728\u6210\u719F\u7684\u5934\u53D1\u957F\u51FA\u6765\u4E4B\u524D\uFF0C\u5B69\u5B50\u539F\u6765\u7684\u5934\u53D1\u4F1A\u5148\u8131\u843D\uFF0C\u6240\u4EE5\u5728\u59346\u4E2A\u6708\u5185\u7684\u8131\u53D1\u4E0D\u9700\u8981\u53BB\u5728\u610F\u3002\u5F53\u5B69\u5B50\u5728\u5E8A\u57AB\u4E0A\u78E8\u8E6D\u5934\u76AE\u6216\u8005\u6709\u649E\u5934\u7684\u4E60\u60EF\u65F6\u6389\u4E00\u4E9B\u5934\u53D1\u662F\u975E\u5E38\u5E38\u89C1\u7684\uFF0C\u5F53\u4ED6\u6D3B\u52A8\u591A\u4E86\uFF0C\u5750\u5F97\u591A\u4E86\uFF0C\u4E0D\u518D\u6709\u78E8\u5934\u6216\u649E\u5934\u7684\u4E60\u60EF\u65F6\uFF0C\u8FD9\u79CD\u8131\u53D1\u4F1A\u81EA\u884C\u77EB\u6B63\u3002\u201D</p><p>\u9999\u6E2F\u536B\u751F\u7F72\u662F\u8FD9\u6837\u5199\u7684\uFF1A\u201C\u5B69\u5B50\u5934\u53D1\u6D53\u5BC6\u591A\u5BE1\u7A0B\u5EA6\uFF0C\u662F\u56E0\u4EBA\u800C\u5F02\u7684....\u5B69\u5B50\u5934\u53D1\u7A00\u5C11\u5E76\u4E0D\u662F\u7F3A\u9499\uFF0C\u4E5F\u4E0D\u4E00\u5B9A\u662F\u7F3A\u4E4F\u8425\u517B\u2026.\u201D\u548C\u6211\u4EEC\u628A\u6795\u79C3\u5F53\u505A\u4E00\u4E2A\u75C5\u6765\u8865\u9499\u4E0D\u540C\u7684\u662F\uFF0C\u4ED6\u4EEC\u8BA4\u4E3A\u9664\u4E86\u540E\u6795\u4F4D\u7F6E\u4EE5\u5916\u7684\u660E\u663E\u8131\u53D1\uFF0C\u624D\u9700\u8981\u770B\u533B\u751F\u3002</p><p><strong>\u603B\u7ED3</strong></p><p>\u6795\u79C3\u662F\u5B69\u5B50\u6362\u53D1\u5BFC\u81F4\u7684\u751F\u7406\u73B0\u8C61\u800C\u4E0D\u662F\u4EC0\u4E48\u75BE\u75C5\uFF0C\u548C\u7F3A\u9499\u65E0\u5173\u3002\u5982\u679C\u4EC5\u4EC5\u662F\u6795\u79C3\u800C\u6CA1\u6709\u522B\u7684\u75C7\u72B6\uFF0C\u5C31\u6839\u672C\u4E0D\u9700\u8981\u4E0A\u533B\u9662\uFF0C\u66F4\u4E0D\u9700\u53BB\u9A8C\u8840\u3001\u62CD\u7247\u3001\u67E5\u9AA8\u5BC6\u5EA6\u4EC0\u4E48\u7684\u3002</p><p>\u9664\u975E\u662F\u65E9\u4EA7\u3001\u4F4E\u51FA\u751F\u4F53\u91CD\u7684\u5B69\u5B50\uFF0C\u4E00\u5C81\u524D\u6BCD\u4E73\u548C\u914D\u65B9\u5976\u57FA\u672C\u80FD\u6EE1\u8DB3\u5B69\u5B50\u9499\u7684\u9700\u6C42\uFF0C\u6B63\u5E38\u5B69\u5B50\u751F\u540E\u51E0\u5929\u5F00\u59CB\u6BCF\u5929\u8865\u5145400IU\u7684\u7EF4\u751F\u7D20D,\u4E00\u5C81\u540E\u591A\u559D\u725B\u5976\u7B49\u9499\u542B\u91CF\u9AD8\u7684\u996E\u98DF\u5C31\u53EF\u4EE5\u9884\u9632\u4F5D\u507B\u75C5\uFF0C\u5E76\u4E0D\u9700\u8981\u989D\u5916\u8865\u9499\uFF0C\u5373\u4FBF\u8981\u8865\u9499\u4E5F\u662F\u8981\u5148\u68C0\u67E5\u5B69\u5B50\u7684\u65E5\u5E38\u996E\u98DF\u662F\u5426\u5B58\u5728\u4E0D\u8DB3\u3001\u662F\u5426\u6709\u4F5D\u507B\u75C5\u7684\u8868\u73B0\u518D\u505A\u51B3\u5B9A\u3002</p><p>\u8FC7\u91CF\u8865\u9499\u53EF\u80FD\u5BFC\u81F4\u5B69\u5B50\u4FBF\u79D8\uFF0C\u5F71\u54CD\u94C1\u3001\u950C\u7684\u5438\u6536\uFF0C\u589E\u52A0\u80BE\u810F\u8D1F\u62C5\uFF0C\u628A\u6795\u79C3\u548C\u7F3A\u9499\u548C\u4F5D\u507B\u75C5\u5212\u4E0A\u7B49\u53F7\uFF0C\u5DF2\u7ECF\u8BA9\u592A\u591A\u7684\u5B69\u5B50\u8865\u4E86\u4E0D\u5FC5\u8981\u7684\u9499\u3002\u6795\u79C3\u4E0D\u662F\u75C5\uFF0C\u5168\u6C11\u8865\u9499\u624D\u662F\u75C5\u3002\uFF08\u672C\u6587\u9996\u53D1\u4E8E2014\u5E74\uFF09</p>',25),l={href:"http://mp.weixin.qq.com/s?__biz=MzA5NzE5ODIyOQ==&mid=2651626240&idx=1&sn=7d504ecc68b5c763e56af424effe9e6e&scene=21#wechat_redirect",target:"_blank",rel:"noopener noreferrer"},h=c("\u67E5\u770B\u539F\u6587");function g(f,m){const p=r("ExternalLinkIcon");return t(),n(a,null,[_,e("p",null,[e("a",l,[h,o(p)])])],64)}var b=d(i,[["render",g]]);export{b as default};
